/**
 * @class VizbeePlayerDelegate
 * @description Defines the interface for handling player-related callbacks from the Vizbee SDK.
 * Developers should extend this class and implement these methods to control the video player.
 */
export default class VizbeePlayerDelegate {

    /**
     * @method onPlay
     * @description Called when a play command is received.
     */
    onPlay() {}

    /**
     * @method onPause
     * @description Called when a pause command is received.
     */
    onPause() {}

    /**
     * @method onSeek
     * @description Called when a seek command is received.
     * @param {number} seekPos - The position to seek to, in seconds.
     */
    onSeek(seekPos) {}

    /**
     * @method onStop
     * @description Called when a stop command is received.
     * @param {string} stopReason - The reason for stopping playback.
     */
    onStop(stopReason) {}

    /**
     * @method getVideoInfo
     * @description Should return the current video information.
     * @returns {Object} An object containing information about the current video.
     */
    getVideoInfo() {}

    /**
     * @method getVideoStatus
     * @description Should return the current status of the video playback.
     * @returns {Object} An object containing the current status of the video playback.
     */
    getVideoStatus() {}
}

/**
 * @class VizbeePlayerState
 * @description Defines constants for various states of the video player in the Vizbee SDK.
 * These states can be used to track and manage the player's current condition.
 */
export default class VizbeePlayerState {
    /**
     * @readonly
     * @type {string}
     * @description Player is in an idle state, not playing any content.
     */
    static get IDLE() { return "idle" };

    /**
     * @readonly
     * @type {string}
     * @description Player is preparing to play content.
     */
    static get PREPARING() { return "preparing" };

    /**
     * @readonly
     * @type {string}
     * @description Player is loading content.
     */
    static get LOADING() { return "loading" };

    /**
     * @readonly
     * @type {string}
     * @description Playback has started.
     */
    static get STARTED() { return "started" };

    /**
     * @readonly
     * @type {string}
     * @description Content is actively playing.
     */
    static get PLAYING() { return "playing" };

    /**
     * @readonly
     * @type {string}
     * @description Playback is paused.
     */
    static get PAUSED() { return "paused" };

    /**
     * @readonly
     * @type {string}
     * @description Player is buffering content.
     */
    static get BUFFERING() { return "buffering" };

    /**
     * @readonly
     * @type {string}
     * @description Playback has been interrupted.
     */
    static get INTERRUPTED() { return "interrupted" };

    /**
     * @readonly
     * @type {string}
     * @description Playback has finished.
     */
    static get FINISHED() { return "finished" };

    /**
     * @readonly
     * @type {string}
     * @description Playback has failed.
     */
    static get FAILED() { return "failed" };
};

/**
 * @class VizbeeVideoInfo
 * @description Represents detailed information about a video in the Vizbee SDK.
 * This class provides methods to set and get various properties of a video.
 */
export default class VizbeeVideoInfo {

    /**
     * @constructor
     * @description Initializes a new instance of VizbeeVideoInfo with default values.
     */
    constructor() {

        this._guid = "";
        this._isLive = false;
        this._startPosition = 0;

        this._videoURL = "";
        this._imageURL = "";

        this._title = "";
        this._subtitle = "";
        this._description = "";

        this._tracks = [];

        this._customStreamInfo = undefined;
        this._customMetadata = undefined;
    }

    /**
     * @method toRNVideoInfo
     * @description Converts the VizbeeVideoInfo object to a plain JavaScript object for React Native.
     * @returns {Object} A plain JavaScript object representing the video information.
     */
    toRNVideoInfo() {

        let rnVideoInfo = {};
        rnVideoInfo.guid = this._guid;
        rnVideoInfo.isLive = this._isLive;
        rnVideoInfo.startPosition = this._startPosition;

        rnVideoInfo.videoUrl = this._videoURL;
        rnVideoInfo.imgUrl = this._imageURL;

        rnVideoInfo.title = this._title;
        rnVideoInfo.subtitle = this._subtitle;
        rnVideoInfo.description = this._description;

        rnVideoInfo.tracks = this._tracks;

        rnVideoInfo.customStreamInfo = this._customStreamInfo;
        rnVideoInfo.customMetadata = this._customMetadata;

        return rnVideoInfo;
    }

    /**
     * @method fromRNVideoInfo
     * @description Populates the VizbeeVideoInfo object from a plain JavaScript object.
     * @param {Object} rnVideoInfo - A plain JavaScript object containing video information.
     */
    fromRNVideoInfo(rnVideoInfo) {

        if (!rnVideoInfo) {
            return;
        }

        this._guid = rnVideoInfo.guid;
        this._isLive = rnVideoInfo.isLive;
        this._startPosition = rnVideoInfo.startPosition;

        this._videoURL = rnVideoInfo.videoURL;
        this._imageURL = rnVideoInfo.imageURL;

        this._title = rnVideoInfo.title;
        this._subtitle = rnVideoInfo.subtitle;
        this._description = rnVideoInfo.description;

        this._tracks = rnVideoInfo.tracks;

        this._customStreamInfo = rnVideoInfo.customStreamInfo;
        this._customMetadata = rnVideoInfo.customMetadata;
    }

    /**
     * @property {boolean} isLive
     * @description Indicates whether the video is a live stream.
     */
    set isLive(isLive) {
        this._isLive = isLive;
    }
    get isLive() {
        return this._isLive;
    }

    /**
     * @property {string} guid
     * @description Unique identifier for the video.
     */
    set guid(guid) {
        this._guid = guid;
    }
    get guid() {
        return this._guid;
    }

    /**
     * @property {string} videoURL
     * @description URL of the video content.
     */
    set videoURL(videoURL) {
        this._videoURL = videoURL;
    }
    get videoURL() {
        return this._videoURL;
    }

    /**
     * @property {string} imageURL
     * @description URL of the video thumbnail or poster image.
     */
    set imageURL(imageURL) {
        this._imageURL = imageURL;
    }
    get imageURL() {
        return this._imageURL;
    }

    /**
     * @property {string} title
     * @description Title of the video.
     */
    set title(title) {
        this._title = title;
    }
    get title() {
        return this._title;
    }

    /**
     * @property {string} subtitle
     * @description Subtitle or secondary title of the video.
     */
    set subtitle(subtitle) {
        this._subtitle = subtitle;
    }
    get subtitle() {
        return this._subtitle;
    }

    /**
     * @property {string} description
     * @description Detailed description of the video.
     */
    set description(description) {
        this._description = description;
    }
    get description() {
        return this._description;
    }

    /**
     * @property {number} startPosition
     * @description Starting position of the video in seconds.
     */
    set startPosition(startPosition) {
        this._startPosition = startPosition;
    }
    get startPosition() {
        return this._startPosition;
    }

    /**
     * @property {Array} tracks
     * @description Array of track information (e.g., subtitles, audio tracks).
     */
    set tracks(tracks) {
        this._tracks = tracks;
    }
    get tracks() {
        return this._tracks;
    }

    /**
     * @property {Object} customStreamInfo
     * @description Custom streaming information for the video.
     */
    set customStreamInfo(customStreamInfo) {
        this._customStreamInfo = customStreamInfo;
    }
    get customStreamInfo() {
        return this._customStreamInfo;
    }

    /**
     * @property {Object} customMetadata
     * @description Custom metadata associated with the video.
     */
    set customMetadata(customMetadata) {
        this._customMetadata = customMetadata;
    }
    get customMetadata() {
        return this._customMetadata;
    }
}

import VizbeePlayerState from "./VizbeePlayerState";

/**
 * @class VizbeeVideoStatus
 * @description Represents the current status of a video in the Vizbee SDK.
 * This class provides methods to set and get various properties related to the video's playback status.
 */
export default class VizbeeVideoStatus {

    /**
     * @constructor
     * @description Initializes a new instance of VizbeeVideoStatus with default values.
     */
    constructor() {

        this._guid = "";
        this._playbackState = VizbeePlayerState.IDLE;
        this._isPlayingAd = false;

        this._currentPosition = -1;
        this._duration = -1;
    }

    /**
     * @property {string} guid
     * @description Unique identifier for the video.
     */
    set guid(guid) {
        this._guid = guid;
    }
    get guid() {
        return this._guid;
    }

    /**
     * @property {string} playbackState
     * @description Current state of the video playback (e.g., IDLE, PLAYING, PAUSED).
     * @see VizbeePlayerState for possible values.
     */
    set playbackState(playbackState) {
        this._playbackState = playbackState;
    }
    get playbackState() {
        return this._playbackState;
    }

    /**
     * @property {boolean} isPlayingAd
     * @description Indicates whether an advertisement is currently playing.
     */
    set isPlayingAd(isPlayingAd) {
        this._isPlayingAd = isPlayingAd;
    }
    get isPlayingAd() {
        return this._isPlayingAd;
    }

    /**
     * @property {number} currentPosition
     * @description Current playback position in milliseconds.
     * @description Sets to -1 if the position is Infinity.
     */
    set currentPosition(positionInMillisecs) {
        if (positionInMillisecs === Infinity) {
            positionInMillisecs = -1;
        }
        this._currentPosition = positionInMillisecs;
    }
    get currentPosition() {
        return this._currentPosition;
    }

    /**
     * @property {number} duration
     * @description Total duration of the video in milliseconds.
     * @description Sets to -1 if the duration is Infinity (e.g., for live streams).
     */
    set duration(durationInMillisecs) {
        if (durationInMillisecs === Infinity) {
            durationInMillisecs = -1;
        }
        this._duration = durationInMillisecs;
    }
    get duration() {
        return this._duration;
    }

    /**
     * @method toJSON
     * @description Converts the VizbeeVideoStatus object to a plain JavaScript object.
     * @returns {Object} A plain JavaScript object representing the video status.
     */
    toJSON() {
        return {
            guid: this.guid,
            playbackState: this.playbackState,
            isPlayingAd: this.isPlayingAd,
            currentPosition: this.currentPosition,
            duration: this.duration
        };
    }
}
